(23, 'Выставка франшиз в Тюмени', '24-25 апреля в Тюмени состоится  II Всероссийский форум «Франчайзинг: новый потенциал в развитии регионов».', '<p>24-25 апреля в Тюмени состоится  II Всероссийский форум «Франчайзинг: новый потенциал в развитии регионов». Организаторы форума Правительство Тюменской области, Комитет Совета Федерации по федеративному устройству, региональной политике, местному самоуправлению и делам Севера, Российская Ассоциация Франчайзинга, генеральный партнер – ОАО «Сбербанк России». </p>\r\n\r\n<p>Как и в прошлом году, центральной  темой тюменского форума станет развитие регионального франчайзинга, который означает создание местными успешными предприятиями собственных франшиз и продвижение их на рынке.</p>\r\n\r\n<p>В рамках форума наряду с конференц-мероприятиями традиционно будет проходить выставка франчайзинговых концепций. Свои франшизы представят около 50 международных, федеральных и региональных франчайзеров.</p>\r\n\r\n<p>На  сегодняшний день свое участие подтвердили  франчайзеры из Москвы, Нижнего Новгорода, Омска, Новосибирска и Тюмени. Среди известных брендов, которые будут презентованы на выставке: «Арсенал +», «Ступеньки», «Этажи», SPAR, «Кванта+», сеть кофеен «Максим», «Золотая середина», «Мебельвилль»,  «Молоток», «Спортмастер», Milana, «Миладенежка», «Наука шоу» и «Пузыри шоу», «Пятерочка», «Перекресток», «Точка красоты», «Автосуши»,  Apels,  «Газпромоптика», Papa John’s, Hesburger. </p>\r\n\r\n<p>Франчайзеры будут ждать своих будущих партнеров-франчайзи на выставке франшиз, которая состоится в рамках II Всероссийского форума «Франчайзинг: новый потенциал в развитии регионов», 24-25 апреля в Западно-Сибирском инновационном центре. Каждый заинтересованный в покупке франшизы получит возможность оценить и сравнить концепции, задать волнующие его вопросы представителю франчайзера и выбрать наиболее подходящее для себя франчайзинговое предложение.</p>\r\n\r\n<p>Подробная информация и регистрация на сайте мероприятия франшиза-форум.рф. Участие бесплатное. Необходима предварительная регистрация.</p>\r\n\r\n<p>С уважением, Оргкомитет форума<br />\r\n<span style=\"line-height: 1.6em;\">Контактное лицо:</span><br />\r\n<span style=\"line-height: 1.6em;\">Светлана Бортвина,</span><br />\r\n<span style=\"line-height: 1.6em;\">(3452) 605-785,</span><br />\r\n<span style=\"line-height: 1.6em;\">pr.forum72@gmail.com</span></p>', '2013-04-04 13:21:00', '/files/news/26dde253.jpg', 15, 1),
