(75, 'Lorem ipsum dolor sit amet', '', '<p>Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.</p>', '2014-09-19 13:37:00', '/files/news/9304bda9.jpg', 62, 1),
(44, 'Развитие  регионального франчайзинга', 'Бизнес по франчайзингу в современном мире пользуется популярностью. Преимущество работы по данной системе очевидны...', '<p>Бизнес&nbsp;по франчайзингу в современном мире пользуется популярностью. Преимущество работы по данной системе очевидны: &laquo;покупка&raquo; готовой жизнеспособной модели предприятия, а также поддержка и консультации уже опытных коллег из компании франчайзера при работе и дальнейшем развитии.&nbsp;&nbsp;</p>\r\n\r\n<p>Есть&nbsp;потребность&nbsp;&ndash;&nbsp;есть предложения. Как&nbsp;и&nbsp;любая&nbsp;сфера&nbsp;деятельности франчайзинг&nbsp;требует&nbsp;развития и&nbsp; информационной открытости, поэтому&nbsp; ежегодно в стране проводятся многочисленные мероприятия: форумы, выставки, круглые столы и семинары в разных регионах России.</p>\r\n\r\n<p>Отличительной особенностью тюменских форумов является присутствие на нем не только известных российских и зарубежных брендов, но и успешных региональных франшиз из субъектов Российской Федерации. В настоящее время в стране региональный франчайзинг находится в стадии развития, но потенциальные возможности его внедрения достаточно велики. Региональный франчайзинг, призванный способствовать модернизации бизнеса, росту уровня занятости населения и повышению благосостояния, может стать одним из главных инструментов совершенствования потребительского рынка муниципальных образований. И речь идет не только о привлечении федеральных франчайзинговых концепций в регионы, и о поддержке региональных компаний, которые уже &laquo;доросли&raquo; до тиражирования своего опыта по франчайзингу.</p>\r\n\r\n<p>Стоит отметить, что&nbsp;франчайзинг&nbsp; &ndash;&nbsp;это&nbsp;не только проверенные&nbsp;временем предприятия, но и&nbsp;соответствующие&nbsp; стандарты&nbsp;работы и&nbsp;обслуживания Клиентов. Появление&nbsp;на рынке&nbsp;сильных&nbsp; игроков&nbsp;стимулирует&nbsp;развитие других компаний в этом сегменте.</p>\r\n\r\n<p>В сложившейся&nbsp;ситуации на рынке, франчайзинг&nbsp; характерен для крупных городов: областных центров, городов-миллиоников, а также быстроразвивающиеся городов.</p>\r\n\r\n<p>В России на региональном уровне существует потребность в покупке и развитии франшиз &laquo;эконом&raquo;-сегмента для городов численностью менее 300&nbsp;000 человек. Поскольку уровень потребителей в муниципальных образованиях и провинциальных городах за последнее время значительно возрос. Но крупные федеральные франшизы не заинтересованы в развитии на данных территориях.</p>\r\n\r\n<p>&laquo;Сегодня&nbsp;все&nbsp;больше жителей&nbsp; муниципальных&nbsp;образований&nbsp;и&nbsp; городов&nbsp;спутников&nbsp;приезжают&nbsp; в&nbsp;областной&nbsp;центр. Они&nbsp;видят&nbsp; и&nbsp;на себе испытывают уровень&nbsp;сервиса&nbsp; в&nbsp;заведениях общественного&nbsp;питания&nbsp; и&nbsp;торговых центрах. Такого же сервиса&nbsp; и&nbsp;отношения&nbsp;они&nbsp;ждут и&nbsp;от участников потребительского рынка&nbsp;своих&nbsp;городов. Ведь к&nbsp;хорошему быстро привыкаешь! В связи с этим я вижу развитие предприятий по системе франчайзинга в таких городах как Ишим, Тобольск, Ялуторовск и Заводоуковск. Горожане уже привыкли и к сетевым магазинам и к хорошему сервису&raquo;, - прокомментировал данный вопрос Андрей Вадимович Пантелеев, начальник управления лицензирования и регулирования потребительского рынка Тюменской области.</p>', '2013-04-15 17:21:00', '/files/news/53fd93ae.jpg', 15, 1),
(58, 'Открытие юбилейного магазина SOHO', 'Сеть салонов обуви и аксессуаров премиальных мировых брендов SOHO продолжает расширять свое присутствие в регионах России...', '<p><span style=\"line-height: 1.6em;\">Сеть салонов обуви и аксессуаров премиальных мировых брендов SOHO продолжает расширять свое присутствие в регионах России в рамках франчайзингового партнерства. 23 марта в  г. Санкт Петербург состоялось  праздничное открытие юбилейного  тридцатого концептуального мультибрендового салона SOHO в ТРК \"Континент\" на Звездной. Гостей ждали подарки, скидки и дисконтные карты.  А приятная музыка и фуршет создали  праздничную атмосферу! </span></p>\r\n\r\n<div class=\"row-fluid\">\r\n<div class=\"span4\"><img alt=\"\" src=\"http://xn----7sba1ae1acmlh7ach5c.xn--p1ai/files/2.JPG\" style=\"width: 100%;\" />\r\n<p> </p>\r\n</div>\r\n\r\n<div class=\"span4\"><img alt=\"\" src=\"http://xn----7sba1ae1acmlh7ach5c.xn--p1ai/files/3.JPG\" style=\"width: 100%;\" />\r\n<p> </p>\r\n</div>\r\n\r\n<div class=\"span4\"><img alt=\"\" src=\"http://xn----7sba1ae1acmlh7ach5c.xn--p1ai/files/4.JPG\" style=\"width: 100%;\" />\r\n<p> </p>\r\n</div>\r\n</div>', '2013-04-17 12:47:00', '/files/news/e23c8aa6.jpg', 15, 1),
