(28, '<p>Каждая квартира ТДСК вводится в эксплуатацию с улучшенной черновой отделкой.</p>\r\n\r\n<p>В квартирах уже есть необходимые приборы, с помощью которых легко сократить расходы на услуги ЖКХ:</p>\r\n\r\n<ul>\r\n	<li>электронные двухтарифные - день/ночь - счетчики учета электроэнергии,</li>\r\n	<li>приборы учета горячей и холодной воды.</li>\r\n</ul>\r\n\r\n<p>Установлены домофон, абонентский распределительный шкаф с двумя розетками с возможностью подключе-<br />\r\nния сети Интернет, кабельного и IP-ТВ, проведены линии телефонной связи.</p>\r\n\r\n<p>В подъездах &ndash; 2 входа - на лестницу и в лифтовой холл. Предусмотрены пандусы для маломобильных групп населения.</p>\r\n\r\n<p>В каждом подъезде 2 лифта - грузовой и пассажирский.</p>\r\n\r\n<h3><span style=\\\"font-family:arial,helvetica,sans-serif\\\">Панорама 1-комнатной квартиры</span></h3>\r\n\r\n<p><object classid=\\\"clsid:D27CDB6E-AE6D-11cf-96B8-444553540000\\\" height=\\\"400\\\" width=\\\"665\\\"><param name=\\\"movie\\\" value=\\\"/files/tdsk/3d-tour/DSK.swf\\\" /><!--[if !IE]>--><object height=\\\"400px\\\" width=\\\"665px\\\"></object><!--<![endif]--></object></p>', 60),
